import React, { Component } from "react";
export default class City extends Component {
  constructor() {
    super();
    this.detals = {};
  }
  componentDidMount = () => {
    this.setState(
      {
        detals: this.props
          .specificCity(this.props.match.params.cityName)
          .then((result) => {
            console.log(result);
          }),
      },
      () => {
        console.log(this.detals);
      }
    );
  };
  render() {
    return <h1>City of {this.props.match.params.cityName}</h1>;
  }
}
